import * as React from 'react'
import Box from '@mui/material/Box'
import Paper from '@mui/material/Paper'

const Home = () => {
    return (    
      <Box sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
            m: 1,
            width: 128,
            height: 128,
        },
      }}
      >
      </Box>
    );
  };

  export default Home;
